    "okefenokee-national-wildlife-refuge-annual-narrative-report-calendar-year-1998",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Okefenokee
    NWR and Banks Lake NWR outlines Refuge accomplishments during the 1998 calendar
    year. The report begins with an introduction to the Refuge. Highlights and weather
    conditions are summarized for the year. Information about monitoring and studies-
    including surveys and censuses and studies and investigations- is provided next.
    Habitat restoration and management projects are also covered; activities include
    wetland restoration, upland restoration, water level management, timber management,
    prescribed burning, and vegetation control. Fish and wildlife management are discussed
    next with emphasis on disease monitoring and nest structures. Coordination activities,
    such as interagency coordination and private land activities, are outlined. The
    resource protection section provides an update on law enforcement, wildfire preparedness,
    and cultural resource management. Information about public education and recreation
    is given including visitor services and outreach. Finally, general administration
    is discussed in the Refuge planning and administration section.",nt"license_title":
